const{app:app,BrowserWindow:BrowserWindow,Menu:Menu,shell:shell}=require("electron"),path=require("path"),{autoUpdater:autoUpdater}=require("electron-updater"),log=require("electron-log");function createWindow(){const e=new BrowserWindow({width:1024,height:768,icon:path.join(__dirname,"icon.ico"),webPreferences:{nodeIntegration:!1}});e.loadURL("https://www.spinfinite.com");const o=[{label:"Web",submenu:[{label:"Reload",click:()=>e.reload()},{label:"Back",click:()=>{e.webContents.canGoBack()&&e.webContents.goBack()}},{label:"Forward",click:()=>{e.webContents.canGoForward()&&e.webContents.goForward()}}]},{label:"Help",submenu:[{label:"Made by Anthony",click:()=>{shell.openExternal("https://www.spinfinite.com")}}]}],n=Menu.buildFromTemplate(o);Menu.setApplicationMenu(n),autoUpdater.checkForUpdatesAndNotify()}autoUpdater.logger=log,autoUpdater.logger.transports.file.level="info",app.whenReady().then(createWindow);